"""Contains many 8-bit APN functions"""

from sage.all import GF, PolynomialRing

# global variables of the module
N = 8
F = GF(2**N, name="a")
g = F.gen()
POLY_RING = PolynomialRing(F, "X")
X = POLY_RING.gen()


def poly_to_lut(p):
    s = []
    for x_i in range(0, 2**N):
        y = (p(F.from_integer(x_i))).to_integer()
        s.append(y)
    return s


